import React from 'react'
import "./Project.css"
const Project = () => {
    const Item = [
        {
            serial_no:"1",
            name:"Jonathan James",
            text:"Interior",
        },
        {
            serial_no:"2",
            name:"Jonathan James",
            text:"Interior",
        },
        {
            serial_no:"3",
            name:"Jonathan James",
            text:"Interior",
        },
    ]
  return (
    <div>
       {Item.map((item) => (
            <div className='project-card' key={item.serial_no}>
                <div className='project-card-left'>
                    <div className='project-card-left-no'>{item.serial_no}.</div>
                    <div className='project-card-left-text'>{item.name}</div>
                </div>
                <div className='project-card-right'>
                    <div className='project-card-right-text'>{item.text}</div>
                </div>
            </div>
        ))}
    </div>
  )
}

export default Project
